import React from 'react';

function Tournament({ tournament }) {
  return (
    <tr>
      <th colSpan="2">
        {tournament}
      </th>
    </tr>
  );
}

function TournamentTable({ products }) {
  const rows = [];
  let lastCategory = null;

  products.forEach((product) => {
    if (product.category !== lastCategory) {
      rows.push(
        <ProductCategoryRow
          category={product.category}
          key={product.category} />
      );
    }
    rows.push(
      <ProductRow
        product={product}
        key={product.name} />
    );
    lastCategory = product.category;
  });

  return (
    <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>Price</th>
        </tr>
      </thead>
      <tbody>{rows}</tbody>
    </table>
  );
}

const Home = () => {
  return (
    <div
      style={{
        margin: '5vh'
      }}
    >
      <h1>Willkommen auf Competico, der einzig wahren E-Sports-Turnier-Website</h1>

      <Tournament />
    </div>
  );
};
  
export default Home;
